export default (function(a,b,c,d,e){return {data:{y24ZCXWssJ:{data:{id:2623,attributes:{imdbId:"tt1340800",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTU2OTkwNzMyM15BMl5BanBnXkFtZTcwOTI4ODg2Ng@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.1\u002F10"},{Source:"Rotten Tomatoes",Value:"84%"},{Source:"Metacritic",Value:"85\u002F100"}],item_lang:{data:{id:3286,attributes:{title:c,plot:"In the early 1970s during the Cold War, the head of British Intelligence, Control (Sir John Hurt), resigns after an operation in Budapest, Hungary goes badly wrong. It transpires that Control believed one of four senior figures in the service was in fact a Russian Agent, a mole, and the Hungary operation was an attempt to identify which of them it was. George Smiley (Gary Oldman) had been forced into retirement by the departure of Control, but is asked by a senior government figure to investigate a story told to him by rogue Agent Ricky Tarr (Tom Hardy), that there was a mole. Smiley considers that the failure of the Hungary operation and the continuing success of Operation Witchcraft (an apparent source of significant Soviet Intelligence) confirms this, and takes up the task of finding him.",slug:"tinker-tailor-soldier-spy"}}},books:{data:[{id:12554,attributes:{title:d,description:"British agent George Smiley ferrets out a mole in the Secret Service and begins his epic game of international chess with his Soviet counterpart, an agent named Karla. By the best-selling author of The Honourable Schoolboy. Reissue.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=pikhngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["John Le Carre"],firstBook:true,published:"2011-06-01",publisher:"Penguin Group USA",subtitle:b}},{id:12555,attributes:{title:d,description:"George Smiley, an agent at the very highest level of British Intelligence, enters the twilight world of espionage and his own past when he is assigned to discover which of his four closest colleagues is a double agent.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Ia785bbC57IC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["John le Carre"],firstBook:a,published:"2002-01-01",publisher:"Simon and Schuster",subtitle:b}},{id:12556,attributes:{title:c,description:"In his fifth outing George Smiley is facing a remarkable challenge- a mole who has burrowed his way in and up to the highest level of British Intelligence.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=rYQ8wQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["John le Carré"],firstBook:a,published:"2020-02-27",publisher:"Penguin Classics",subtitle:"The Smiley Collection"}},{id:12557,attributes:{title:e,description:"Three thrilling tales of espionage from the superselling author of The Spy Who Came in from the Cold. Le Carre's highly acclaimed spy thrillers enjoy long stays on the New York Times bestseller list. Includes Tinker, Tailor, Soldier, Spy, The Honourable Schoolboy, and Smiley's People.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ub5Tdg3VeDcC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[e],firstBook:a,published:"1995-01-01",publisher:"Wings",subtitle:"Three Complete Novels"}},{id:12558,attributes:{title:"Understanding John Le Carré",description:"John Cobbs establishes that contemporary English novelist John le Carre's fiction transcends the genre of espionage, and that le Carre is preeminently a social commentator who writes novels of manners. Cobbs analyzes each of le Carre's novels and offers a biographical sketch, describing le Carre's often overlooked academic success and reputation as a once member of British Intelligence.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=D-tBTfe0eEIC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["John L. Cobbs"],firstBook:a,published:"1998-01-01",publisher:"Univ of South Carolina Press",subtitle:b}}]}}},meta:{}}},prerenderedAt:1680940907859}}(null,"","Tinker Tailor Soldier Spy","Tinker, Tailor, Soldier, Spy","John Le Carré"))